import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { useSelector } from 'react-redux';
import Admin from './pages/Admin';
import Home from './pages/Home';
import Login from './pages/Login';
import 'bootstrap/dist/css/bootstrap.min.css';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';

function App() {
  const isLoggedIn = useSelector((state) => state.auth.user !== null);
  const userType = useSelector((state) => state.auth.user?.userType);

  return (
    <div className="App">
      <Router>
        {isLoggedIn && (
          <Navbar bg="primary" variant="dark">
            <Container>
              <Navbar.Brand href="/">{userType === 'admin' ? 'Admin' : 'Home'} Page</Navbar.Brand>
              <Nav className="me-auto">
                {userType === 'admin' && <Nav.Link href="/admin">Admin</Nav.Link>}
                {userType === 'employee' && <Nav.Link href="/home">Home</Nav.Link>}
              </Nav>
            </Container>
          </Navbar>
        )}
        <Routes>
          <Route path="/" element={isLoggedIn ? <Navigate to={userType === 'admin' ? '/admin' : '/home'} replace /> : <Login />} />
          <Route path="/admin" element={isLoggedIn && userType === 'admin' ? <Admin /> : <Navigate to="/admin" replace />} />
          <Route path="/home" element={isLoggedIn && userType === 'employee' ? <Home /> : <Navigate to="/home" replace />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
